import { BrowserRouter } from "react-router-dom";
import "./styles/styles.scss";
import Header from "./templates/header/Header";
import Navbar from "./templates/header/Navbar";
import MenuTemplate from "./templates/menuTemplate/MenuTemplate";
import Banners from "./components/Banners/Banners";
import { menu1, menu2, menu3 } from "./components/Menu/MenuContent";

function App() {
  return (
    <BrowserRouter>
      <Navbar />
      <Header />
      <MenuTemplate menu={menu1} content={<Banners />} />
      <MenuTemplate menu={menu2} content={<Banners />} />
      <MenuTemplate menu={menu3} content={<Banners />} />
    </BrowserRouter>
  );
}

export default App;
